import React from "react";
import { Switch, Route } from "react-router";
import WorkerDashboard from "./Dashboards/WorkerDashboard";

const MainRouter = () => (
  <div>
    <Switch>
      <Route exact path="/worker-dashboard" component={WorkerDashboard} />
    </Switch>
  </div>
);

export default MainRouter;
